import 'package:flutter/material.dart';import 'package:flutter_bloc/flutter_bloc.dart';import 'delegate.dart';export 'delegate.dart';class Home extends StatefulWidget {  const Home({Key? key}) : super(key: key);  @override  State<Home> createState() => _HomeState();}class _HomeState extends State<Home> {  @override  void initState() {    super.initState();    context.read<HomeDelegateCubit>().state.pushPage(name: '/');    // if (!kIsWeb) initialize();  }  @override  Widget build(BuildContext context) {    return Router(      routerDelegate: context.read<HomeDelegateCubit>().state,    );  }}